import 'package:flutter/material.dart';
import 'package:flutter_svg/flutter_svg.dart';
import 'package:gap/gap.dart';

class HomePageV2 extends StatefulWidget {
  const HomePageV2({super.key});

  @override
  State<HomePageV2> createState() => _HomePageV2State();
}

class _HomePageV2State extends State<HomePageV2> {
  int tabIndex = 0;
  @override
  Widget build(BuildContext context) {
    final width = MediaQuery.of(context).size.width;
    final hight = MediaQuery.of(context).size.height;
    return Scaffold(
      body: Row(
        children: [
          Container(
            width: 100,
            height: MediaQuery.of(context).size.height,
            decoration: BoxDecoration(
              color: Color(0xffffffff),
              boxShadow: [
                BoxShadow(
                  blurRadius: 5,
                  color: Colors.grey.shade400,
                ),
              ],
            ),
            child: Column(
              mainAxisAlignment: MainAxisAlignment.center,
              crossAxisAlignment: CrossAxisAlignment.center,
              children: [
                Container(
                  height: 54,
                  width: 54,
                  decoration: BoxDecoration(
                    borderRadius: BorderRadius.circular(10),
                  ),
                  child: Image.asset("assets/logo_hr.png"),
                ),
                Gap(50),
                getTabs(
                  index: 0,
                  svg:
                      """<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="25" height="25" viewBox="0 0 25 25"><image id="home" width="25" height="25" xlink:href="data:image/png;base64,"/></svg>""",
                  toolTip: "Home",
                ),
                Gap(10),
                getTabs(
                  index: 2,
                  svg:
                      """<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="25" height="25" viewBox="0 0 25 25"><image id="user" width="25" height="25" xlink:href="data:image/png;base64,"/></svg>""",
                  toolTip: "Profile",
                ),
                Gap(10),
                getTabs(
                  index: 3,
                  svg:
                      """<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="25" height="25" viewBox="0 0 25 25"><image id="bell" width="25" height="25" xlink:href="data:image/png;base64,"/></svg>""",
                  toolTip: "Notifications",
                ),
                Gap(10),
                getTabs(
                  index: 4,
                  svg:
                      """<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="25" height="25" viewBox="0 0 25 25"><image id="setting_1_" data-name="setting (1)" width="25" height="25" xlink:href="data:image/png;base64,"/></svg>""",
                  toolTip: "Setting",
                ),
              ],
            ),
          ),
          Expanded(
            child: ListView(
              padding: EdgeInsets.only(
                top: hight * 0.1,
                left: width * 0.05,
                right: width * 0.02,
              ),
              children: [
                Text(
                  "Good Morning, Rahim Md. Earteza",
                  style: Theme.of(context).textTheme.headlineMedium,
                ),
                Gap(40),
                Wrap(
                  children: List<Widget>.generate(
                    10,
                    (index) {
                      return Container(
                        width: 372,
                        height: 172,
                        margin: const EdgeInsets.all(10),
                        decoration: BoxDecoration(
                          color: Colors.green.withOpacity(0.1),
                          borderRadius: BorderRadius.circular(10),
                        ),
                      );
                    },
                  ),
                ),
              ],
            ),
          ),
        ],
      ),
    );
  }

  Widget getTabs({
    required int index,
    required String svg,
    String? toolTip,
  }) {
    return Container(
      height: 54,
      width: 54,
      decoration: BoxDecoration(
        color: tabIndex == index ? Color(0xFFE1FFD9) : null,
        borderRadius: BorderRadius.circular(10),
      ),
      child: IconButton(
        style: IconButton.styleFrom(
          shape: RoundedRectangleBorder(
            borderRadius: BorderRadius.circular(10),
          ),
        ),
        onPressed: () {
          setState(() {
            tabIndex = index;
          });
        },
        tooltip: toolTip,
        icon: SvgPicture.string(
          svg,
          colorFilter: ColorFilter.mode(
            tabIndex == index ? Colors.green : Colors.black,
            BlendMode.srcIn,
          ),
        ),
      ),
    );
  }
}
